function [dx,dy,d4x,d4y,d2xd2y]=computeDerivativesSquareWithHoleBiharmonic(x,y)

%  r=sqrt(2)/2;
%  syms x y
%  u=((x-4)^2)*((x+4)^2)*((y-4)^2)*((y+4)^2)*((x^2+y^2-r^2)^2);
% diff(u,x,x,y,y)
 
f_dx =@(x,y) (2*x - 8)*(x + 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + (2*x + 8)*(x - 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + 4*x*(x - 4)^2*(x + 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2);
f_dy =@(x,y) (2*y - 8)*(x - 4)^2*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + (2*y + 8)*(x - 4)^2*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2)^2 + 4*y*(x - 4)^2*(x + 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2);
 
f_d4x=@(x,y) 24*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + 48*(x - 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 48*(x + 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 24*(x - 4)^2*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 96*x^2*(x - 4)^2*(y - 4)^2*(y + 4)^2 + 96*x^2*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 96*x^2*(2*x - 8)*(2*x + 8)*(y - 4)^2*(y + 4)^2 + 48*(2*x - 8)*(2*x + 8)*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 96*x*(2*x - 8)*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 96*x*(2*x + 8)*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 96*x*(2*x - 8)*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 96*x*(2*x + 8)*(x - 4)^2*(y - 4)^2*(y + 4)^2;
f_d4y=@(x,y) 24*(x - 4)^2*(x + 4)^2*(x^2 + y^2 - 1/2)^2 + 48*(x - 4)^2*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 48*(x - 4)^2*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 24*(x - 4)^2*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 96*y^2*(x - 4)^2*(x + 4)^2*(y - 4)^2 + 96*y^2*(x - 4)^2*(x + 4)^2*(y + 4)^2 + 96*y^2*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x + 4)^2 + 48*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x + 4)^2*(x^2 + y^2 - 1/2) + 96*y*(2*y - 8)*(x - 4)^2*(x + 4)^2*(x^2 + y^2 - 1/2) + 96*y*(2*y + 8)*(x - 4)^2*(x + 4)^2*(x^2 + y^2 - 1/2) + 96*y*(2*y - 8)*(x - 4)^2*(x + 4)^2*(y + 4)^2 + 96*y*(2*y + 8)*(x - 4)^2*(x + 4)^2*(y - 4)^2;

f_d2xd2y=@(x,y) 4*(x - 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(x - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + 8*(x - 4)^2*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 8*(x - 4)^2*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 8*(x - 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 8*(x + 4)^2*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 8*(x - 4)^2*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 4*(2*x - 8)*(2*x + 8)*(y - 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(2*x - 8)*(2*x + 8)*(y + 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x^2 + y^2 - 1/2)^2 + 4*(2*y - 8)*(2*y + 8)*(x + 4)^2*(x^2 + y^2 - 1/2)^2 + 16*x^2*(x - 4)^2*(x + 4)^2*(y - 4)^2 + 16*x^2*(x - 4)^2*(x + 4)^2*(y + 4)^2 + 16*y^2*(x - 4)^2*(y - 4)^2*(y + 4)^2 + 16*y^2*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 16*x^2*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x + 4)^2 + 16*y^2*(2*x - 8)*(2*x + 8)*(y - 4)^2*(y + 4)^2 + 8*(2*x - 8)*(2*x + 8)*(y - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 8*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x + 4)^2*(x^2 + y^2 - 1/2) + 16*x*(2*x - 8)*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 16*x*(2*x - 8)*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 16*x*(2*x + 8)*(x - 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 16*x*(2*x + 8)*(x - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*y - 8)*(x - 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*y - 8)*(x + 4)^2*(y + 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*y + 8)*(x - 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*y + 8)*(x + 4)^2*(y - 4)^2*(x^2 + y^2 - 1/2) + 4*(2*x - 8)*(2*x + 8)*(2*y - 8)*(2*y + 8)*(x^2 + y^2 - 1/2)^2 + 16*x*(2*x - 8)*(x + 4)^2*(y - 4)^2*(y + 4)^2 + 16*x*(2*x + 8)*(x - 4)^2*(y - 4)^2*(y + 4)^2 + 16*y*(2*y - 8)*(x - 4)^2*(x + 4)^2*(y + 4)^2 + 16*y*(2*y + 8)*(x - 4)^2*(x + 4)^2*(y - 4)^2 + 32*x*y*(2*x - 8)*(2*y - 8)*(x + 4)^2*(y + 4)^2 + 32*x*y*(2*x - 8)*(2*y + 8)*(x + 4)^2*(y - 4)^2 + 32*x*y*(2*x + 8)*(2*y - 8)*(x - 4)^2*(y + 4)^2 + 32*x*y*(2*x + 8)*(2*y + 8)*(x - 4)^2*(y - 4)^2 + 16*x*(2*x - 8)*(2*y - 8)*(2*y + 8)*(x + 4)^2*(x^2 + y^2 - 1/2) + 16*x*(2*x + 8)*(2*y - 8)*(2*y + 8)*(x - 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*x - 8)*(2*x + 8)*(2*y - 8)*(y + 4)^2*(x^2 + y^2 - 1/2) + 16*y*(2*x - 8)*(2*x + 8)*(2*y + 8)*(y - 4)^2*(x^2 + y^2 - 1/2);
 
dx=f_dx(x,y);
dy=f_dy(x,y);
d4x=f_d4x(x,y);
d4y=f_d4y(x,y);
d2xd2y=f_d2xd2y(x,y);

end

